export class NguoiDung {
    constructor(id, email, matKhau, nhapLaiMatKhau, hoTen, biDanh, avatar, soDT, maNhomQuyen){
        this.id = id;
        this.email = email;
        this.matKhau = matKhau;
        this.nhapLaiMatKhau = nhapLaiMatKhau;
        this.hoTen = hoTen;
        this.biDanh = biDanh;
        this.avatar = avatar;
        this.soDT = soDT;
        this.maNhomQuyen = maNhomQuyen;
    }
}